import React from "react";
import Box from "./Box";
import "../App.css";
const WaterVending = () => {
  return (
    <span className="WaterVending">
      <Box id="A1" />
      <Box id="A2" />
      <Box id="A3" />
      <Box id="B1" />
      <Box id="B2" />
      <Box id="B3" />
    </span>
  );
};
export default WaterVending;
